import React from 'react';
import './App.css';
import Navbar from '.src\\/components/Navbar';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/pages';
import About from './components/pages/about';
import Events from './components/pages/events';
import AnnualReport from './components/pages/annual';
import Teams from './components/pages/team';
import Blogs from './components/pages/blogs';
import SignUp from './components/pages/signup';
function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path = '/' exact component = {Home} />
        <Route path = '/about' exact component = {Home} />
        <Route path = '/events' exact component = {Home} />
        <Route path = '/annual' exact component = {Home} />
        <Route path = '/team' exact component = {Home} />
        <Route path = '/blogs' exact component = {Home} />
        <Route path = '/sign-up' exact component = {Home} />
      </Routes>
</Router>
  );
}

export default App;
